import React from 'react';
import '../../css/dashboard.css';
import Forests from '../../assets/image/Group 13.svg';

export const Tracker=()=>{
    return(
        <div className="tracker-content">
            <img src={Forests} alt="forest"/>
                    <div>
                        <p>FRIDAY &#x2022; 32<sup>&#xb0;</sup>C</p>
                    </div>
                    <div className="task-tracker-button">
                        <button className="task-tracker-button-1">22 tasks today</button>
                        <button className="task-tracker-button-2">3 deadlines today</button>
                    </div>
        </div>
    )
}
